function bhide(config){
  $('#buildings_table tr:not(:first)').each(function(i,e){
    var h = true;
    var a = $(e).find('td');
    for(i=0;i<config.length;i++){
      if(config[i]!=$(a[i+4]).text()){
        h = false;
        break;
      }
    }
    if(h) e.parentNode.removeChild(e);
  });
}
for (i in config) bhide(config[i]);
